To model this dynamic system in MATLAB, you need to set up the equations of motion based on the given mechanical system. This system can be described by two second-order differential equations. Here's the step-by-step process to model the system and solve it using MATLAB:

1. **Define the system parameters**:
   - \( m_1 \) and \( m_2 \) are the masses.
   - \( k_1 \) and \( k_2 \) are the spring constants.
   - \( c_1 \) and \( c_2 \) are the damping coefficients.
   - \( f_1 \) and \( f_2 \) are the external forces applied to masses \( m_1 \) and \( m_2 \) respectively.
   - \( x_1(t) \) and \( x_2(t) \) are the displacements of masses \( m_1 \) and \( m_2 \) from their equilibrium positions.

2. **Set up the equations of motion** using Newton's second law:

   For mass \( m_1 \):
   \[
   m_1 \ddot{x}_1 + c_1 \dot{x}_1 + k_1 x_1 + c_2 (\dot{x}_1 - \dot{x}_2) + k_2 (x_1 - x_2) = f_1
   \]

   For mass \( m_2 \):
   \[
   m_2 \ddot{x}_2 + c_2 (\dot{x}_2 - \dot{x}_1) + k_2 (x_2 - x_1) = f_2
   \]

3. **Convert these equations into a state-space representation**. Define the state variables:
   \[
   \mathbf{y} = \begin{bmatrix}
   x_1 \\
   \dot{x}_1 \\
   x_2 \\
   \dot{x}_2
   \end{bmatrix}
   \]

   The state-space representation will then be:
   \[
   \dot{\mathbf{y}} = \mathbf{A} \mathbf{y} + \mathbf{B} \mathbf{u}
   \]

   Where:
   \[
   \mathbf{A} = \begin{bmatrix}
   0 & 1 & 0 & 0 \\
   -\frac{k_1 + k_2}{m_1} & -\frac{c_1 + c_2}{m_1} & \frac{k_2}{m_1} & \frac{c_2}{m_1} \\
   0 & 0 & 0 & 1 \\
   \frac{k_2}{m_2} & \frac{c_2}{m_2} & -\frac{k_2}{m_2} & -\frac{c_2}{m_2}
   \end{bmatrix}
   \]

   \[
   \mathbf{B} = \begin{bmatrix}
   0 & 0 \\
   \frac{1}{m_1} & 0 \\
   0 & 0 \\
   0 & \frac{1}{m_2}
   \end{bmatrix}
   \]

   \[
   \mathbf{u} = \begin{bmatrix}
   f_1 \\
   f_2
   \end{bmatrix}
   \]

4. **Implement in MATLAB**:

```matlab
% Define system parameters
m1 = 1; % mass 1
m2 = 1; % mass 2
k1 = 100; % spring constant 1
k2 = 100; % spring constant 2
c1 = 10; % damping coefficient 1
c2 = 10; % damping coefficient 2

% Define the state-space matrices
A = [0 1 0 0;
     -(k1+k2)/m1 -(c1+c2)/m1 k2/m1 c2/m1;
     0 0 0 1;
     k2/m2 c2/m2 -k2/m2 -c2/m2];

B = [0 0;
     1/m1 0;
     0 0;
     0 1/m2];

% Initial conditions
y0 = [0; 0; 0; 0]; % Initial displacement and velocity

% Define time vector
t = linspace(0, 10, 1000); % 10 seconds, 1000 points

% Define the input functions
f1_step = @(t) 1 * (t >= 0);
f2_step = @(t) 0 * (t >= 0);

f1_impulse = @(t) (t == 0);
f2_impulse = @(t) 0;

f1_ramp = @(t) t * (t >= 0);
f2_ramp = @(t) 0;

% Define the system of ODEs
sys_ode = @(t, y, f1, f2) A * y + B * [f1(t); f2(t)];

% Solve the ODE for step response
[t_step, y_step] = ode45(@(t, y) sys_ode(t, y, f1_step, f2_step), t, y0);

% Solve the ODE for impulse response
[t_impulse, y_impulse] = ode45(@(t, y) sys_ode(t, y, f1_impulse, f2_impulse), t, y0);

% Solve the ODE for ramp response
[t_ramp, y_ramp] = ode45(@(t, y) sys_ode(t, y, f1_ramp, f2_ramp), t, y0);

% Plot the results
figure;
subplot(3,1,1);
plot(t_step, y_step(:,1), t_step, y_step(:,3));
title('Step Response');
xlabel('Time (s)');
ylabel('Displacement (m)');
legend('x1', 'x2');
grid on;

subplot(3,1,2);
plot(t_impulse, y_impulse(:,1), t_impulse, y_impulse(:,3));
title('Impulse Response');
xlabel('Time (s)');
ylabel('Displacement (m)');
legend('x1', 'x2');
grid on;

subplot(3,1,3);
plot(t_ramp, y_ramp(:,1), t_ramp, y_ramp(:,3));
title('Ramp Response');
xlabel('Time (s)');
ylabel('Displacement (m)');
legend('x1', 'x2');
grid on;
```

